A scalar type represents a single value. Pint has four primary scalar types: integers, reals, Booleans, and 256-bit hashes. Integer Type An integer is a number without a fractional component. Pint has a single integer type called int which, when targeting the EssentialVM, represents a 64-bit signed integer . An int, therefore, can store numbers from −(2n−1) to 2n−1−1 inclusive, where n is the number of bits that represent the integer (64 in the case of EssentialVM). You can write integer literals in any of the forms shown in the table below. Note that number literals can use _ as a visual separator to make the number easier to read, such as 1_000, which will have the same value as if you had specified 1000. Number literals Examples Decimal 12_333 Hex 0x123f Binary 0b1111_1101 Real Type Note Pint only has preliminary support for reals Pint also has a type called real that represents real values. Real values are usually represented in computers using floating-point or fixed-point numbers. Because Pint is essentially a constraint modeling language, we do not specify exactly how a real is represented and we leave that decision to the backend. What matters here is that a decision variable of type real is not constrained to be an integer. This has implications on constraint solvers where, typically, solving for a continuous variable (i.e. a real) is much easier than solving for an integer. Here's an example that shows some decision variables initialized to real literals: var x = 1.05;
var y = 42e8;
var z = 2.5e-4;
var w: real = 1.3E5;
var u: real = 0.34; Numeric Operations Pint supports the basic mathematical operations you’d expect for integers and reals: addition, subtraction, multiplication, division, and remainder. Integer division truncates toward zero to the nearest integer. The following code shows how you’d use each numeric operation in a var statement: // addition
var sum = 1 + 2 + 3; // subtraction
var difference = 15.3 - 1e-1; // multiplication
var product = 42 * 42; // division
var quotient = 3.3/2.0;
var truncated = -5 / 3; // Results is -1 // remainder
var remainder = 34 % 3; Note that binary operators in Pint are strict with regards to what types they allow, that is, only identical types can be used in a binary operator. For example, adding an integer and a real is not a valid operation and will result in a compile error. The Boolean Type As in most other programming languages, a Boolean type in Pint has two possible values: true and false. The Boolean type in Pint is specified using bool. For example: var t = true;
var f: bool = false; The b256 Type The b256 is a special type that represents a 256-bit hash. It is often used to represent addresses or storage keys and cannot be used as a numerical integers. That is, two b256 values cannot added for example. A b256 literals can be represented using a Hexadecimal or a Binary literal as follows: var addr1 = 0x3333333333333333333333333333333333333333333333333333333333333333;
var addr2: b256 = 0b1111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111;

