Compound types can group multiple values into one type. Pint has two primitive compound types: tuples and arrays. The Tuple Type A tuple is a general way of grouping together a number of values with a variety of types into one compound type. Tuples have a fixed length: once declared, they cannot grow or shrink in size. We create a tuple by writing a comma-separated list of values inside curly brackets { .. }. Each position in the tuple has a type, and the types of the different values in the tuple don’t have to be the same. We’ve added optional type annotations in this example: var tup_1: { int, real, bool } = { 42, 4.2, true }; The variable tup binds to the entire tuple because a tuple is considered to be a single compound element. To get the individual values out of a tuple, we can use the period (.) operator followed by the index of the value we want to access. For example: var tup_2: { int, real, bool } = { 42, 4.2, true };
var tup_2_first = tup_2.0;
var tup_2_second = tup_2.1;
var tup_2_third = tup_2.2; This program creates the tuple tup_2 and then accesses each element of the tuple using its respective index. As with most programming languages, the first index in a tuple is 0. It is also possible to name some or all the fields of a tuple type as follows: var tup_3: { x: int, real, y: bool } = { 42, 4.2, true }; Note that, in this example, only two out of the 3 fields are named. In order to access the individual elements of a tuple with named fields, the period (.) can again be used with either the index of the tuple field or its name. For example: var tup_4: { x: int, real, y: bool } = { 42, 4.2, true };
var tup_4_first = tup_4.0;
var tup_4_first_named = tup_4.x; // same as `tup_4.0`
var tup_4_second = tup_4.1;
var tup_4_third = tup_4.2;
var tup_4_third_named = tup_4.y; // same as `tup_4.y` Tuples without any values are not allowed in Pint. That is, the following: var empty: { } = { }; is disallowed and errors out as follows: Error: empty tuple types are not allowed ╭─[ch_3_2.pnt:43:12] │ 43 │ var empty: {} = {}; │ ─┬ │ ╰── empty tuple type found
────╯
Error: empty tuple expressions are not allowed ╭─[ch_3_2.pnt:43:17] │ 43 │ var empty: {} = {}; │ ─┬ │ ╰── empty tuple expression found
────╯ The Array Type Another way to have a collection of multiple values is with an array. Unlike a tuple, every element of an array must have the same type. Unlike arrays in some other languages, arrays in Pint have a fixed length. We write the values in an array as a comma-separated list inside square brackets: var a = [1, 2, 3, 4, 5]; You write an array's type using the element type followed by its size between square brackets, like so: var b: int[5] = [1, 2, 3, 4, 5]; Here, int is the type of each element. The number 5 indicates that the array contains five elements. You can access elements of an array using by indexing into it, like this: var c: int[5] = [1, 2, 3, 4, 5];
var c_first = c[0];
var c_second = c[1]; In this example, the variable named c_first will get the value 1 because that is the value at index 0 in the array. The variable named c_second will get the value 2 from index 1 in the array.

