Enums allow you to define a type by enumerating its possible variants. Where structs and tuples give you a way of grouping together related fields and data, like a User with its status, address, and balance, enums give you a way of saying a value is one of possible set of values. For example, we may want to say that User is one of a set of possible account types that also includes Contract. To do this, Pint allows us to encode these possibilities as an enum. Let’s look at a situation we might want to express in code and see why enums are useful. Say we need to work with three possible tokens: DAI, USDC, and USDT. Because these are the only tokens we want to work with, we can enumerate all possible variants, which is where enumeration gets its name: enum Token = DAI | USDC | USDT; Note how the possible variants of Token are separated by a |. Token is now a custom data type that we can use elsewhere in our code. Also, we can now create an instance of each of the three variants of Token like this: var dai: Token = Token::DAI;
var usdc: Token = Token::USDC;
var usdt: Token = Token::USDT; Note that the variants of the enum are namespaced under its identifier, and we use a double colon to separate the two. This is useful because now all three values Token::DAI, Token::USDC, and Token::USDT are of the same type: Token. We can then, for instance, declare a variable called token_type to be of type Token and assign it to either variants depending on how large some value amount is. var amount: int;
var token_type: Token = cond { amount in 0..1000 => Token::DAI, amount in 1001..2000 => Token::USDC, else => Token::USDT,
}; We can even use enums inside structs as follows: type Bal = { token: Token, bal: int, }; var user1_bal = { token: Token::DAI, bal: 42, }; var user2_bal = { token: Token::USDC, bal: 96, }; var user3_bal = { token: Token::USDT, bal: 100, };

