Each smart contract has an interface which can be easily generated from the contract. The interface is not required to write the smart contract but is required to interact with the contract from external contexts . For example, one smart contract can propose an update to a storage variables that is owned by another contract. Will will go over how to do that in Chapter 5 . A contract interface has the following structure: interface ExternalContract { storage { // storage variables } predicate Foo { // all **public** decision variables } predicate Bar { // all **public** decision variables } // other constraint sets
} You can see the similarities between the structure of the interface and the structure of the smart contract. An interface starts with interface keyword followed by the name of the interface which can be used when referring the interface from external contexts. Inside the interface declaration, an optional storage block can be declared as well as a list of predicate interfaces . These predicate interfaces contain all the public decision variables that the predicates expose. We will discuss public decision variables in detail in Chapter 6.1 , but for now, you can think of these variables as regular decision variable except that they can be read from an external context. Let's revisit the counter example but with a small modification where we have made all decision variables pub, which marks them as public: storage { counter: int,
} predicate Initialize { pub var value: int; state counter: int = storage::counter; constraint counter' == value;
} predicate Increment { pub var amount: int; state counter: int = storage::counter; constraint counter' == counter + amount;
} An interface for the contract above looks like this: interface Counter { storage { counter: int, } predicate Initialize { pub var value: int; } predicate Increment { pub var amount: int; }
} Hopefully nothing here is surprising! The key point is that an interface must expose everything that is public in a contract, and that includes the storage block and all public decision variables in each predicate. Note that, if a predicate Foo has no public decision variables, both predicate Foo { } and predicate Foo; can be used when adding it to the interface. Note in the future, Pint will have a tool that will auto-generate interfaces.

