predicate Send { var from: b256; var receiver: b256; var amount: int; state from_balance = storage::balances[from]; state receiver_balance = storage::balances[receiver]; constraint amount < from_balance; constraint from_balance' == from_balance - amount; constraint receiver_balance' == receiver_balance + amount;
